window.bookSummaryJSON = "<p>Following her departure from Faerie, Alice tries to adjust to the rhythm of her old life. But confusing emotions draw her into a new venture with Dorothy, a girl from a neighboring farm. When the pair are transported to a whole new part of Faerie, Alice encounters former acquaintances who, like her, haven't moved past what transpired in the Unseelie kingdom. With a new, powerful enemy fixating on Dorothy, and with trauma evolving into trust, Alice must decide if she can afford to risk her heart . . . again.</p> <p>Contains mature themes. Trigger and content warnings are available on the author's website.</p>"; 
